import React from "react";
import { NavLink } from 'react-router-dom';

export const Header = (props) => {

	return (
			<div>
			<nav>
			<div>
			<div>
			<ul>
			<NavLink exact to = "/" activeClassName="selected">
			Home
			</NavLink>
			<NavLink exact to = "/ticket" activeClassName="selected">
			Ticket
			</NavLink>
			<NavLink exact to = "/feature" activeClassName="selected">
			Features
			</NavLink>
			<NavLink exact to = "/user" activeClassName="selected">
			<img src={require("../images/btn_google_signin_dark_normal_web.png")}/>
			</NavLink>

			</ul>
			</div>
			</div>
			</nav>
			</div>
			);

};

export default Header;
